import axios from "axios";
import {EMPLOYEE_BASE_REST_API_URL, LOGIN_PATH, REGISTER_PATH,LOGOUT_PATH} from "./ApiPaths";
import { Response } from "./Response";
const instance = axios.create(
    {withCredentials : true}
);

export class RedirectWithData {
    constructor(data, redirectLocation) {
        this.data = data;
        this.redirect = redirectLocation
    }
}

export class ConnectApi {
    amit() {
        return instance.get(EMPLOYEE_BASE_REST_API_URL)
            .then(res => {
                return new Response(res.data);
            })
            .catch(res => undefined);
    }
    
    Login(email, password) {
        return instance.post(LOGIN_PATH,
            {
                email: email,
                password: password,
            })
            .then(res => {
                return new Response(res.data);
            })
            .catch(res => undefined);
    }

    Logout() {
        return instance.get(LOGOUT_PATH)
            .then(res => {
                return new Response(res.data);
            })
            .catch(res => undefined);
    }
    
    async Register(email, password, first_name, last_name) {
        return await instance.post(REGISTER_PATH,
            {
                email: email,
                password: password,
                first_name: first_name,
                last_name: last_name,
            })
            .then(res => {
                return Response(res.data);
            })
            .catch(res => undefined);
    }
}
